description:
The Makeup Artist Handbook (2nd Ed.): Techniques for Film, Television, Photography, and Theatre
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


Get professional techniques usually known only by Hollywood makeup artists in this full-color, comprehensive book from accomplished makeup pros Gretchen Davis and Mindy Hall. The two come to you with impressive backgrounds in film and television industries.
Their projects have included Pearl Harbor, Rent, Stuart Little, and The Nanny Diaries, and Mindy Hall is fresh off her Academy Award win for her work on the 2009 Star Trek.

Author: Gretchen Davis, Mindy Hall
Title: The Makeup Artist Handbook (2nd Ed.): Techniques for Film, Television, Photography, and Theatre
Publisher: Focal Press
Year: 2012
Format: PDF


